import React from 'react';

const ProductViewInCart = ({ data }) => {
	console.log(data);
	return (
		<div className='productInCart'>
			<h2>{data.title}</h2>
			<img src={data.image} alt='' />
			<style jsx>
				{`
					.productInCart {
						margin-top: 70px;
						border: 1px solid grey;
					}
				`}
			</style>
		</div>
	);
};

export default ProductViewInCart;
